import React from 'react';
import './About.css';

const Footer = () => {
  return (
    <section className="about-section">
      <div className="about-container">
        <div className="about-left">
          <h2 className="about-title">About Me</h2>
          <p className="about-description">
            I’m Marc Anthony Casale, a passionate web developer with over 6 years of experience. I specialize in building user-friendly websites and applications that seamlessly blend functionality and design. I’m always excited to solve complex problems and contribute to innovative projects.
          </p>
          <p className="about-description">
            My expertise spans across multiple technologies including Laravel, Vue.js, React, and WordPress. I love to keep learning and adapting to new challenges, always striving for excellence in everything I do.
          </p>
        </div>
        <div className="about-right">
          <img src={`${process.env.PUBLIC_URL}/assets/DP.jpg`} alt="Profile" />
        </div>
      </div>
    </section>



  );
};

export default Footer;
